import React from 'react';
import './Footer.css';
import {
  Container,
  Navbar,
  NavbarBrand
} from 'reactstrap';

const Footer = () => {
  return (
    <div className="fixed-bottom">
      <Navbar color="orange" dark>
        <Container>
          <NavbarBrand>SISTEMA DE VENTAS Equipo MINTECH.3</NavbarBrand>
        </Container>
      </Navbar>
    </div>
  )

};

export default Footer;
